import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
  <h1> ANR Netflix Pick</h1>,
  <ol>
    <li>Coffee</li>
    <li>Tea</li>
    <li>Milk</li>
  </ol>,
  document.getElementById("root")
);

var h1 = document.createElement("h1");
h1.innerHTML = "anr";
document.getElementById("root").appendChild(h1);
